O primeiro algorítmo que vamos discutir é conhecido como MD2, o primeiro da família MD (Message Digest) e foi desenvolvido por Ronald Rivest em 1989. Ele foi projetado especificamente para computadores de 8 bits. Apesar de ter sido uma inovação importante, o MD2 se tornou obsoleto com o tempo devido a ataques criptográficos bem-sucedidos. Suas principais características eram: Tamanho da saída: 128 bits (16 bytes) Entrada de tamanho variável Projetado para máquinas de 8 bits Inseguro desde 2004 devido a ataques práticos Lento em hardware moderno devido à otimização para 8 bits Como o MD2 Funciona? A especificação do MD2 pode ser encontrada na RFC 1319. Esse algorítmo transforma qualquer entrada em um hash de 128bits. Ele faz isso seguindo 3 etapas principais: 1 - Padding Para garantir que o tamanho da entrada seja um múltiplo de 16 bytes, adicionamos bytes de padding no final. A regra é a seguinte: se o tamanho da mensagem já for múltiplo de 16, adicionamos 16 bytes de 0x10. se falta N bytes para completar 16, adicionamos N bytes do valor N Exemplo: Entrada original: [41 42 43] = "ABC"
Tamanho: 3 bytes
Padding necessário: 16 - 3 = 13 bytes
Resultado final: [41 42 43 0D 0D 0D 0D 0D 0D 0D 0D 0D 0D 0D 0D] 2 - Checksum O MD2 adiciona um checksum de 16 bytes, que é computado iterando sobre a mensagem e aplicando XOR com uma tabela de permutação. Essa tabela de permutação S-box (256 valores) foi escolhida manualmente por Rivest e usada para misturar os dados. A fórmula para calcular o checksum de 16 bytes é: checksum[j] = checksum[j] XOR S(block[i] XOR checksum[j - 1]) Isso adiciona o efeito de difusão na mensagem antes da fase final. 3 - Processamento Principal Agora pegamos a mensagem + checksum e a processamos usando uma permutação de 48 bytes, misturando os blocos de 16 bytes repetidamente. O buffer inicial (48 bytes) é atualizado 18 vezes para fortalecer a resistência a colisões. O MD2 não usa operações de bitwise complexas como rotação, apenas XOR e tabelas de substituição são usadas. Implementação do MD2 em Go A tabela S-box define os bytes que serão permutados internamente. package main import ( "fmt"
) // Tabela de permutação S-box
var S = [256]byte{ 41, 46, 67, 201, 162, 216, 124, 1, 61, 54, 84, 161, 236, 240, 6, 19, 98, 167, 5, 243, 192, 199, 115, 140, 152, 147, 43, 217, 188, 76, 130, 202, 30, 155, 87, 60, 253, 212, 224, 22, 103, 66, 111, 24, 138, 23, 229, 18, // (o restante foi omitido por brevidade, consulte a RFC 1319)
} func MD2(input []byte) [16]byte { // Parte 1: Padding paddingSize := 16 - (len(input) % 16) padding := make([]byte, paddingSize) for i := range padding { padding[i] = byte(paddingSize) } input = append(input, padding...) // Parte 2: Checksum var checksum [16]byte var L byte = 0 for i := 0; i < len(input); i += 16 { for j := 0; j < 16; j++ { checksum[j] ^= S[input[i+j]^L] L = checksum[j] } } input = append(input, checksum[:]...) // Parte 3: Transformação Principal var X [48]byte for i := 0; i < len(input); i += 16 { // Copia bloco para X copy(X[16:32], input[i:i+16]) for j := 0; j < 16; j++ { X[32+j] = X[16+j] ^ X[j] } var t byte = 0 // 18 rounds de processamento for round := 0; round < 18; round++ { for j := 0; j < 48; j++ { X[j] ^= S[t] t = X[j] } t += byte(round) } } // O hash final está nos primeiros 16 bytes de X var hash [16]byte copy(hash[:], X[:16]) return hash
} func main() { data := []byte("Mensagem de teste") hash := MD2(data) fmt.Printf("MD2 Hash: %x\n", hash)
}

