O MD4 (Message Digest 4) foi desenvolvido por Ronald Rivest em 1990 como uma melhoria do MD2, projetado especificamente para processadores de 32 bits. Ele introduziu um novo modelo de operação baseado em três rodadas de funções não lineares, tornando-o muito mais rápido que o MD2. No entanto, o MD4 é extremamente fraco e foi quebrado rapidamente. Mesmo assim, sua estrutura inspirou diretamente o MD5 e SHA-1, servindo de base para os algoritmos de hash modernos e que veremos logo mais. Como o MD4 Funciona? A especificação do MD4 pode ser encontrada na RFC 1320. O algoritmo transforma qualquer entrada em um hash de 128 bits usando 3 rodadas de operações baseadas em soma modular e funções booleanas. O MD4 segue 4 etapas principais: 1 - Padding O comprimento da mensagem é ajustado para que seja múltiplo de 512 bits (64 bytes). Um bit 1 é adicionado, seguido de zeros até que faltem 64 bits para completar um bloco. Os últimos 64 bits armazenam o tamanho original da mensagem (antes do padding) Exemplo: Se tivermos a mensagem "abc", que tem 24 bits (3 bytes), adicionamos: 01100001 01100010 01100011 10000000 00000000 ... (até completar 448 bits) E então adicionamos os 64 bits finais contendo o tamanho da mensagem. 2 - Inicialização dos Registradores MD4 usa quatro registradores de 32 bits, inicializados com valores fixos: A = 0x67452301
B = 0xEFCDAB89
C = 0x98BADCFE
D = 0x10325476 Esses valores são inspirados na constante da raiz quadrada de números primos. 3 - Processamento em 3 Rodadas A mensagem é dividida em blocos de 512 bits (64 bytes), e cada bloco passa por três rodadas de operações matemáticas: 3.1 - Função F (AND, OR, NOT) F(X, Y, Z) = (X AND Y) OR (NOT X AND Z) Essa função favore um dos valores (X) e ajuda na difusão. 3.2 - Função G (Majority Vote) G(X, Y, Z) = (X AND Y) OR (X AND Z) OR (Y AND Z) Utiliza uma "votação" entre os três valores. 3.3 - Função H (XOR) H(X, Y, Z) = X XOR Y XOR Z Mistura os bits de forma caótica. Cada uma dessas funções é aplicada a cada bloco de 512 bits da mensagem, alterando os registradores A, B, C e D. 4 - Hash Final Após todas as rodadas, os valores finais dos registradores A, B, C e D são concatenados para formar um hash de 128 bits (16 bytes). Implementação do MD4 em Go package main import ( "encoding/binary" "fmt"
) func leftRotate(x uint32, n uint) uint32 { return (x << n) | (x >> (32 - n))
} // Funções F, G e H do MD4
func F(x, y, z uint32) uint32 { return (x & y) | (^x & z) }
func G(x, y, z uint32) uint32 { return (x & y) | (x & z) | (y & z) }
func H(x, y, z uint32) uint32 { return x ^ y ^ z } // Transformação principal do MD4
func md4Transform(state *[4]uint32, block []byte) { var X [16]uint32 for i := 0; i < 16; i++ { X[i] = binary.LittleEndian.Uint32(block[i*4:]) } a, b, c, d := state[0], state[1], state[2], state[3] // Primeira rodada a = leftRotate(a+F(b, c, d)+X[0], 3) d = leftRotate(d+F(a, b, c)+X[1], 7) c = leftRotate(c+F(d, a, b)+X[2], 11) b = leftRotate(b+F(c, d, a)+X[3], 19) // Segunda rodada a = leftRotate(a+G(b, c, d)+X[0]+0x5A827999, 3) d = leftRotate(d+G(a, b, c)+X[4]+0x5A827999, 5) c = leftRotate(c+G(d, a, b)+X[8]+0x5A827999, 9) b = leftRotate(b+G(c, d, a)+X[12]+0x5A827999, 13) // Terceira rodada a = leftRotate(a+H(b, c, d)+X[0]+0x6ED9EBA1, 3) d = leftRotate(d+H(a, b, c)+X[8]+0x6ED9EBA1, 9) c = leftRotate(c+H(d, a, b)+X[4]+0x6ED9EBA1, 11) b = leftRotate(b+H(c, d, a)+X[12]+0x6ED9EBA1, 15) state[0] += a state[1] += b state[2] += c state[3] += d
} func md4(input []byte) [16]byte { // Padding length := len(input) padding := []byte{0x80} for (len(input)+len(padding))%64 != 56 { padding = append(padding, 0x00) } lengthBits := make([]byte, 8) binary.LittleEndian.PutUint64(lengthBits, uint64(length*8)) input = append(input, padding...) input = append(input, lengthBits...) // Inicializar registradores var state = [4]uint32{0x67452301, 0xEFCDAB89, 0x98BADCFE, 0x10325476} // Processar blocos de 512 bits (64 bytes) for i := 0; i < len(input); i += 64 { md4Transform(&state, input[i:i+64]) } // Converter saída para 16 bytes var hash [16]byte for i := 0; i < 4; i++ { binary.LittleEndian.PutUint32(hash[i*4:], state[i]) } return hash
} func main() { data := []byte("Mensagem de teste") hash := md4(data) fmt.Printf("MD4 Hash: %x\n", hash)
} Ataques Contra o MD4 O MD4 foi um grande avanço na época, mas também teve falhas graves de segurança. Aqui, exploramos os ataques mais relevantes que levaram à sua obsolescência. 1 - Ataque de Colisão (1995) - Hans Dobbertin Em 1995, o criptógrafo Hans Dobbertin publicou um ataque prático contra o MD4, demonstrando que era possível encontrar colisões em alguns segundos. Isso quebra a confiabilidade do algoritmo, pois qualquer atacante pode substituir um documento sem alterar seu hash. Como Dobbertin quebrou o MD4? Ele explorou fraquezas estruturais nas três rodadas do MD4, usando um método conhecido como differential cryptanalysis. Ele encontrou colisões em menos de 1 minuto usando um computador comum da época! 2 - Ataque de Colisão Rápido (2007) - Wang et al. Em 2007, Xiaoyun Wang, Hongbo Yu e Yiqun Lisa Yin aprimoraram os ataques de Dobbertin e conseguiram gerar colisões em tempo real. 3 - Ataque de Pré-imagem (2009) Em 2009, pesquisadores mostraram que dado um hash MD4, era possível reconstruir uma entrada que produzia o mesmo valor. Esse ataque é catastrófico para aplicações que dependem de integridade, como assinaturas digitais. 4 - Ataque a Senhas no NTLM (Windows) O MD4 foi usado no NTLM (Microsoft Windows Authentication). Como os ataques de colisão e pré-imagem são rápidos, foi possível quebrar senhas NTLM em milissegundos. Implementando um Ataque de Colisão Contra MD4 em Go Vamos gerar duas mensagens diferentes com o mesmo hash. package main import ( "fmt"
) // Simulação de colisão no MD4
func findCollision() { msg1 := []byte("Ataque123") msg2 := []byte("At4que123") // Alteração mínima hash1 := md4(msg1) hash2 := md4(msg2) fmt.Printf("Mensagem 1: %s\nHash 1: %x\n", msg1, hash1) fmt.Printf("Mensagem 2: %s\nHash 2: %x\n", msg2, hash2) if hash1 == hash2 { fmt.Println("Colisão encontrada!") } else { fmt.Println("Nenhuma colisão encontrada.") }
} func main() { findCollision()
}
